description:
Charlie plans to make an honest woman out of his girlfriend, May (Jennifer White), a former stripper. But when times get tight and stress levels heighten, people let their emotions get the best of them. Charlie's thing for strippers risks returning, while Mary has some former clients who are always ready to let her be her true self. Sweet Sinner brings you The Stripper for the best in dramatic erotica.

